let currentQuestionIndex = 0;
let score = 0;
let timeRemaining = 60;
let timerInterval;

const questionText = document.getElementById("question-text");
const optionsContainer = document.getElementById("options");
const nextBtn = document.getElementById("next-btn");
const timerDisplay = document.getElementById("timer");
const scoreDisplay = document.getElementById("score");
const mainContainer = document.querySelector("main");

function startQuiz() {
    displayQuestion();
    startTimer();
}

function startTimer() {
    timerInterval = setInterval(() => {
        timeRemaining--;
        timerDisplay.textContent = `Temps : ${timeRemaining}s`;
        if (timeRemaining <= 0) {
            clearInterval(timerInterval);
            endQuiz();
        }
    }, 1000);
}

function displayQuestion() {
    const currentQuestion = questions[currentQuestionIndex];
    questionText.textContent = currentQuestion.question;
    optionsContainer.innerHTML = "";

    currentQuestion.options.forEach(option => {
        const button = document.createElement("button");
        button.textContent = option;
        button.onclick = () => selectAnswer(button, currentQuestion);
        optionsContainer.appendChild(button);
    });
}

function selectAnswer(selectedButton, currentQuestion) {
    const isCorrect = selectedButton.textContent === currentQuestion.answer;

    // Ajoute un effet visuel pour corriger ou incorrect
    selectedButton.style.backgroundColor = isCorrect ? "green" : "red";
    
    // Mise à jour du score si correct
    if (isCorrect) {
        score++;
        scoreDisplay.textContent = `Score : ${score}`;
    }

    // Affiche l'explication
    displayExplanation(currentQuestion);

    // Attendre un moment, puis passer à la question suivante
    setTimeout(() => {
        currentQuestionIndex++;
        if (currentQuestionIndex < questions.length) {
            displayQuestion();
        } else {
            endQuiz();
        }
    }, 3000); // Attend 3 secondes avant de passer à la question suivante
}

function displayExplanation(currentQuestion) {
    const explanationDiv = document.createElement("div");
    explanationDiv.innerHTML = `
        <p><strong>Explication :</strong> ${currentQuestion.explanation}</p>
        <img src="${currentQuestion.illustration}" alt="Illustration" style="max-width: 100%; border-radius: 8px; margin-top: 10px;">
    `;
    optionsContainer.appendChild(explanationDiv);
}

function endQuiz() {
    clearInterval(timerInterval);
    mainContainer.innerHTML = `
        <h2>Quiz Terminé !</h2>
        <p>Votre score final est de ${score} sur ${questions.length}.</p>
        <button onclick="restartQuiz()">Recommencer</button>
    `;
}

function restartQuiz() {
    currentQuestionIndex = 0;
    score = 0;
    timeRemaining = 60;
    scoreDisplay.textContent = `Score : ${score}`;
    timerDisplay.textContent = `Temps : ${timeRemaining}s`;
    startQuiz();
}

// Démarrage du quiz
startQuiz();
